Object.Field:
DECLARE
v_day_truncate varchar2(2);
v_table_name   VARCHAR2 (100) := '#PRY_BRIEF_95061.V_USUARIO_STAGE.TB_REGISTROS_MENSUALES';
v_sqlstr       VARCHAR2 (1000);
BEGIN
    Select EXTRACT (DAY FROM SYSDATE) INTO v_day_truncate
    FROM dual;

    IF (v_day_truncate = '1') OR (v_day_truncate = '01')
        THEN v_sqlstr := 'TRUNCATE TABLE ' || v_table_name;
        EXECUTE IMMEDIATE v_sqlstr;
    END IF;
END;

BEGIN
  EXECUTE IMMEDIATE 'TRUNCATE TABLE CONSULTA_IMEI_BDONEG_TRANS';
END;

DECLARE
CURSOR C_BLOQUEOS IS
    SELECT '<TR ALIGN="LEFT"> 
                <TH WIDTH="15%">' ||TO_CHAR(TRUNC(FECHA),'YYYY/MM/DD')||'</TH>
                <TH WIDTH="15%">' ||PREPAGO|| '</TH>
                <TH WIDTH="15%">' ||POSTPAGO || '</TH>
                <TH WIDTH="15%">' ||TECNOLOGIA || '</TH>
                <TH WIDTH="15%">' ||ARCHIVO || '</TH>
            </TR>' AS CANTIDAD_BLOQUEO
    FROM TB_REGISTROS_MENSUALES
    ORDER BY 1 asc;

CURSOR C_HTML_TAGS IS
    SELECT '</TABLE><p>Detalle identificados mes en curso:</p> 
            <TABLE style="float: left;margin-left:10px" BORDER="1"  WIDTH="80%" CELLPADDING="1" CELLSPACING="1"> 
                          <TR ALIGN="CENTER">
                            <TH WIDTH="15%">Fecha</TH>
                            <TH WIDTH="15%">Equipos con linea postpago</TH>
                            <TH WIDTH="15%">Cambio de tecnologia</TH>
                          </TR>' AS COD_HTML

    FROM DUAL;

CURSOR C_POST_TEC IS
    SELECT '<TR ALIGN="LEFT">
                <TH WIDTH="15%">'||TO_CHAR(TRUNC(FECHA),'YYYY/MM/DD')||'</TH>
                <TH WIDTH="15%">'||POSTPAGO||'</TH>
                <TH WIDTH="15%">'||TECNOLOGIA||'</TH> </TR>' AS POST_TECNO
    FROM TB_REGISTROS_MENSUALES
    ORDER BY 1 asc;

V_HTML_BODY CLOB;
V_HTML_AUX CLOB;
V_HTML_AUX2 CLOB;
V_HTML_AUX3 CLOB;
BEGIN
    FOR BLOQUEO IN C_BLOQUEOS 
        LOOP
        V_HTML_AUX := V_HTML_AUX || TO_CLOB(BLOQUEO.CANTIDAD_BLOQUEO);         
        END LOOP;                

     FOR DATO IN C_POST_TEC              
         LOOP
         V_HTML_AUX2 := V_HTML_AUX2 || TO_CLOB(DATO.POST_TECNO);  
         END LOOP; 
     FOR TAGS IN C_HTML_TAGS              
         LOOP
         V_HTML_AUX3 := V_HTML_AUX3 || TO_CLOB(TAGS.COD_HTML);  
         END LOOP; 
        V_HTML_BODY := V_HTML_AUX || V_HTML_AUX3 || V_HTML_AUX2;
    INSERT INTO #PRY_BRIEF_95061.V_USUARIO_STAGE.TB_REGISTROS_HTML(REGISTRO) VALUES (V_HTML_BODY); 
    COMMIT;
END;
